import React from "react";

const ImageLinkForm = (props) => {
  return (
    <main className="signInForm">
      <form class="measure center">
        <fieldset id="sign_up" class="ba b--transparent ph0 mh0" />
      </form>
    </main>
  );
};
export default ImageLinkForm;
